// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;


import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

// set up Uniswap Router to 
interface ISwapRouter {
    struct ExactInputSingleParams {
       address tokenIn;
       address tokenOut;
       uint24 fee;
       address recipient;
       uint256 deadline;
       uint256 amountIn;
       uint256 amountOutMinimum;
       uint160 sqrtPriceLimitX96;
    }
    function exactInputSingle(ExactInputSingleParams calldata params)
       external
       payable
       returns (uint256 amountOut);
    struct ExactOutputSingleParams {
        address tokenIn;
        address tokenOut;
        uint256 fee;
        uint256 deadline;
        address recipient;
        uint256 amountOut;
        uint256 amountInMaximum;
        uint160 sqrtPriceLimitX96;
    }

    function exactOutputSingle(ExactOutputSingleParams calldata params)
        external
        payable
        returns (uint256 amountIn);
}

interface ICurvePool {
    function get_dy(int128 i, int128 j, uint256 dx) external view returns (uint256);
    function exchange(int128 i, int128 j, uint256 dx, uint256 min_dy) external returns (uint256);
}


contract Arbitrage{
    using SafeERC20 for IERC20;

    ISwapRouter public immutable uniswapRouter;
    ICurvePool public immutable curvePool;

    address constant SWAP_ROUTER_02 = 0xE592427A0AEce92De3Edee1F18E0157C05861564; // might need to change
    address constant WETH = 0xC02aaA39b223FE8D0A0e5C4F27eAD9083C756Cc2;
    address constant USDC = 0xA0b86991c6218b36c1d19D4a2e9Eb0cE3606eB48;

    IERC20 private constant weth = IERC20(WETH);
    IERC20 private constant usdc = IERC20(USDC);

    constructor(address _uniswapRouter, address _curvePool){
        uniswapRouter = ISwapRouter(_uniswapRouter);
        curvePool = ICurvePool(_curvePool);
    }

    function swapExactInputSingleHop(uint256 usdcamountin, uint256 minETHamountout) public {
        usdc.transferFrom(msg.sender, address(this), usdcamountin);
        usdc.approve(address(uniswapRouter), usdcamountin);

        ISwapRouter.ExactInputSingleParams memory params = ISwapRouter.ExactInputSingleParams({
            tokenIn: USDC,
            tokenOut: WETH,
            fee: 3000,
            recipient: msg.sender,
            deadline: block.timestamp,
            amountIn: usdcamountin,
            amountOutMinimum: minETHamountout,
            sqrtPriceLimitX96: 0
        });
        uniswapRouter.exactInputSingle(params);
    }
    function buyEthOnCurve(uint256 usdcAmount, uint256 minEthAmount) public {
        // Swap USDC for ETH, assuming USDC is 0 and ETH is 1
        curvePool.exchange(0, 1, usdcAmount, minEthAmount);
    }
    function swapExactOutputSingleHop(uint256 ethamountout, uint256 maxUSDCamountin) public {
        weth.transferFrom(msg.sender, address(this), maxUSDCamountin);
        weth.approve(address(uniswapRouter), maxUSDCamountin);

        ISwapRouter.ExactOutputSingleParams memory params = ISwapRouter.ExactOutputSingleParams({
            tokenIn: USDC,
            tokenOut: WETH,
            fee: 3000,
            recipient: msg.sender,
            deadline: block.timestamp,
            amountOut: ethamountout,
            amountInMaximum: maxUSDCamountin,
            sqrtPriceLimitX96: 0
        });
        uniswapRouter.exactOutputSingle(params);
    }
    function sellEthonCurve(uint256 ethAmount, uint256 minUsdcAmount) public {
        weth.approve(address(curvePool), minUsdcAmount);
        curvePool.exchange(1, 0, ethAmount, 0);

    }
    function exchangeArbitrage(uint256 usdcAmount) external payable{
        uint256 allowance = usdc.allowance(msg.sender, address(this));
        uint256 balance = usdc.balanceOf(msg.sender);

        require(allowance >= usdcAmount, "Allowance too low");
        require(balance >= usdcAmount, "Insufficient balance");

        usdc.transferFrom(msg.sender, address(this), usdcAmount);
        uint256 uniswap_price = getAmountonUniswap(usdcAmount);
        uint256 curve_price = getAmountonCurve(usdcAmount);

        if (uniswap_price > curve_price){
            // buy from Curve, sell on Uniswap if uniswap ETH is higher
            buyEthOnCurve(usdcAmount, curve_price);
            swapExactOutputSingleHop(usdcAmount, curve_price);

        }
        else{
            swapExactInputSingleHop(usdcAmount, uniswap_price);
            sellEthonCurve(uniswap_price, usdcAmount);

        }


   }

    function getAmountonUniswap(uint256 USDC_amount) public returns(uint256){
        ISwapRouter.ExactInputSingleParams memory params =
            ISwapRouter.ExactInputSingleParams({
               tokenIn: USDC,
               tokenOut: WETH,
               fee: 3000,
               recipient: msg.sender,
               deadline: block.timestamp,
               amountIn: USDC_amount,
               amountOutMinimum: 1,
               sqrtPriceLimitX96: 0
            });
        //emit DebugLog("Calling Uniswap", USDC_amount);

        uint256 amountOut = uniswapRouter.exactInputSingle(params);

        //emit DebugLog("Amount Out", amountOut);

        return amountOut;
   }
   function getAmountonCurve(uint256 usdcamount) public view returns (uint256){
        return curvePool.get_dy(0, 1, usdcamount); // same as above
   }



}
// Uniswap router address: 0xE592427A0AEce92De3Edee1F18E0157C05861564
// Curve router address: 0xbEbc44782C7dB0a1A60Cb6fe97d0b483032FF1C7
// Both are on Ethereum Mainnet

